import { DUMMY_DATA } from "../data.js";
import Face from "./Face.jsx";

export default function InsideDustState(props) {

  let selectDust = props.dusts;
  // let selectDust = "";

  let tabContent = "test";

  if (selectDust) {
    tabContent = (
      <div>
        <div>{DUMMY_DATA[selectDust].face}</div>
        <h1>{DUMMY_DATA[selectDust].dust}</h1>
        <p>{DUMMY_DATA[selectDust].description}</p>
      </div>
    );
  }

  return (
    <>
      <div>{tabContent}</div>
    </>
  );
}
